const MotivationalMessage: React.FC = () => {
    const messages = ["Cada aporte cuenta.", "Gracias por ser parte de este sueÃ±o.", "Juntos, hacemos la diferencia.", "Tu apoyo impulsa el futuro."];
    const [messageIndex, setMessageIndex] = React.useState(0);

    React.useEffect(() => {
        const interval = setInterval(() => {
            setMessageIndex(prev => (prev + 1) % messages.length);
        }, 3000);
        return () => clearInterval(interval);
    }, [messages.length]);

    return (
        <p className="text-center text-sm text-slate-500 dark:text-slate-400 italic transition-opacity duration-500">{messages[messageIndex]}</p>
    );
};

